import React from 'react';
import './Dashboard.css'; // Import a separate CSS file for styling

const Dashboard = ({ user }) => {
  return (
    <div className="dashboard-container">
      <h1 className="dashboard-heading">Welcome to Digital Heritage, {user.name}!</h1>
      <h2 className="wishlist-heading">Your Wishlist:</h2>
      <div className="wishlist-container">
        {user.wishlist && user.wishlist.length > 0 ? (
          user.wishlist.map((item, index) => (
            <div key={index} className="wishlist-item-card">
              <h3>{item}</h3> {/* Display wishlist items */}
            </div>
          ))
        ) : (
          <p className="empty-wishlist">No items in wishlist.</p>
        )}
      </div>
    </div>
  );
};

export default Dashboard;
